import React from "react";

class SearchBar extends React.Component{
  render() {
    const { fetchData } = this.props;

    return (
        <div>
            <input type="text" placeholder="Search.." name="search"/>
            <button type="submit">
                <i class="fa fa-search"/>
            </button>
        </div>
    );
  }
}

export default SearchBar;
